import React from "react";

import classes from "./Pofol.module.css";

const Pofol = (props) => {
  return (
    <ul className={classes.pofol_wrap}>
      {props.items.map((pofol) => (
        <li className={classes.pofol_item} key={pofol.id} type={pofol.type}>
          {pofol.text}
        </li>
      ))}
    </ul>
  );
};

export default Pofol;
